import BottomNav from './src/index.vue'
import BottomNavItem from './src/item.vue'
BottomNav.install = function(Vue) {
  Vue.component(BottomNav.name, BottomNav)
}
BottomNavItem.install = function(Vue) {
  Vue.component(BottomNavItem.name, BottomNavItem)
}
export default { BottomNav, BottomNavItem }
